    <title>Wave</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .page-title-bar {
        font-family: "Cormorant Garamond", serif;
        font-size: 45px;
        font-weight: 300;
      }

      .parentDiv {
        height: 165px;
        display: grid;
        place-items: center left;
        position: relative;
        padding: 30px;
        overflow: hidden;
      }

      .parentDiv::after {
        content: "";
        height: 100vh;
        width: 100%;
        position: absolute;
        top: 0;
        left: 0;
        z-index: -1;
        background-image: url(BG-Pattern.svg);
        background-position: center;
        background-size: cover;
        background-repeat: no-repeat;
        animation: patternAnim 120s linear infinite alternate forwards;
      }
      /*
      #patternBG {
        height: inherit;
        position: absolute;
        top: 0;
        left: 0;
        z-index: -1;
      } */

      /* #topLayer {
        transform-box: fill-box;
        transform-origin: center;
        animation: patternAnim 300s linear infinite alternate forwards;
      } */

      @keyframes patternAnim {
        0% {
          transform: scaleX(1) rotate(0deg) translateY(0px);
        }

        50% {
          transform: scaleX(3) rotate(-30deg) translateY(-300px);
        }

        100% {
          transform: scaleX(2) rotate(30deg) translateY(300px);
        }
      }
    </style>
